import React from 'react'
import './patro.css'
// import url from props.patro.url

const Patro = (props) => {
  return (
    <div>
        <h3>{props.patro.nombre}</h3>
        {console.log(props.patro.url)}
        <img src="src/assets/prueba.png" />
    </div>
  )
}

export default Patro
